  \"2015-12-20T18:36:41.087518\",\n\t\"name\": \"chi-chi-taiwan-earthquake-september-21-1999\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"On September 21, 1999, at 1:47 AM local
  time, a magnitude MW 7.6 earthquake was felt throughout the island of Taiwan. A
  five county area, including the city of Taichung, experienced the greatest number
  of casualties and most severe damage. 2,405 deaths and 10,718 injuries were reported.
  As many as 82,000 housing units were damaged or destroyed, resulting in nearly 600,000
  people being temporarily or permanently displaced from their homes.\",\n\t\"license_title\":
